import React from "react";

const MovieMenu = () => {
  return (
    <div>
      <label>Movies</label>
      <select>
        <option>Now Playing</option>
        <option>Top Rated</option>
        <option>Popular</option>
        <option>UpComing</option>
      </select>
    </div>
  );
};

export default MovieMenu;
